export default function Home() {
  const classes = useStyles();
  
  //const ChartJsImage = require('chartjs-to-image');
  const [chartData1, setChartData1] = useState({});

 
 
  const [data_chart1, setData_chart1] = useState({
    select_date:""
  });

//  function save(e) {
//     //save to png
//     const canvasSave = document.getElementById('chart1');
//     canvasSave.toBlob(function (blob) {
//         saveAs(blob, "Chart1.png")
//     })
// }


  function submit(e){
    e.preventDefault();
    let mdcMessage = [];
    let pmMessage = [];
    var scatter1 =[];
    var scatter2 =[];
    let concatenatedArray =[];
  
    const path1='http://localhost:8000/Landing_Chart_MDC_Scatter/' +data_chart1.select_date ;
    const path2='http://localhost:8000/Landing_Chart_PM_Scatter/' +data_chart1.select_date ;
    
    const req1 = axios.post(path1);
    const req2 = axios.post(path2);
  
    axios.all([ req1,req2])
      .then(axios.spread((...responses) => {
        //const responseOne = responses[0];
        //const responsetwo = responses[1];
       //console.log(responseOne);
       //console.log(responsetwo);
        JSON.parse(responses[0].data).forEach(i => {
          mdcMessage = parseInt(i.of_MDC_Messages);
          scatter1.push({"x": mdcMessage}) 
        });

        JSON.parse(responses[1].data).forEach(i => {
          pmMessage = parseInt(i.of_MX_Actions);
          scatter2.push({"y": pmMessage}) 
        });
        
        // for (const dataObj of JSON.parse(responses[0].data)) {
        //   mdcMessage = parseInt(dataObj.of_MDC_Messages);
        //   scatter1.push({"x":mdcMessage});
        // } 
        // for (const dataObj of JSON.parse(responses[1].data)) {
           
        //      pmMessage = parseInt(dataObj.of_MX_Actions);
        //     scatter2.push({"y":pmMessage});
        // }
        for (let i=0; i<scatter1.length;i++){
          concatenatedArray.push({
            ...scatter1[i],
            ...scatter2[i]
          })
        }  
      
      }
      )).catch(err => {
          //console.log(err)
      })
     
      // console.log(scatter1)
      // console.log(scatter2)
      console.log(concatenatedArray)
      
  
      setChartData1({
          labels: mdcMessage,
          datasets: [
            {
              label: 'fleet',
             // backgroundColor: 'rgba(75,192,192,1)',
              pointBackgroundColor: 'rgba(0, 255, 100, 0.6)',
              hoverBorderColor: 'rgba(255, 155, 100, 1)',
              pointRadius: 10,
              borderColor: 'rgba(0,0,0,1)',
              borderWidth: 2,
              //pointHoverBorderWidth: 15,
              data: concatenatedArray 
            }
          ]
    
        });
  
  }

  function handle(e){
    const newdata={...data_chart1}
    newdata[e.target.id] = e.target.value
    setData_chart1(newdata)
    //console.log(newdata)

  }

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={12}>

          <form className={classes.root1} noValidate autoComplete="off">
            <div>
              <TextField  onChange= {(e)=>handle(e)} value={data_chart1.select_date} id="select_date" label=" SELECT DATE " type="date" defaultValue="2017-05-24" className={classes.textField} InputLabelProps={{ shrink: true, }} /></div>
            <br></br>
            <div style={{ paddingBottom: "20px" }}><Button onClick={(e) => submit(e)} variant="contained" style={{ backgroundColor: "#001C3E", color: "WHITE" }}>GENERATE  </Button>
              <Button  variant="contained" style={{ backgroundColor: "#001C3E", color: "WHITE", float: 'right', marginRight: "1200px" }}>SAVE</Button></div>
          </form>
          <Paper className={classes.paper}>
            <Scatter
            data={chartData1}
            options={{
              scales: {
                xAxes: [{
                    type: 'linear',
                    position: 'bottom'
                }],
              title: { display: true, text: 'Scatter Plot', fontSize: 20 },
              legend: { display: true, position: 'right' }
            }}}
          /></Paper>
        </Grid>
        <Grid item xs={12}>
          <form className={classes.root1} noValidate autoComplete="off">
            <div> <TextField id="top_value" label="Top Values" defaultValue=" " variant="outlined" /></div>
            <br></br>
            <div>  <TextField id="from_date" label=" SELECT FROM DATE &nbsp; &nbsp;" type="date" defaultValue="2017-05-24" className={classes.textField} InputLabelProps={{ shrink: true, }} />
              <TextField id="to_date" label=" SELECT TO DATE " type="date" defaultValue="2017-05-24" className={classes.textField} InputLabelProps={{ shrink: true, }} /></div>
            <br></br>
            <div style={{ paddingBottom: "20px" }}><Button variant="contained" style={{ backgroundColor: "#001C3E", color: "WHITE" }}>GENERATE  </Button>
              <Button variant="contained" style={{ backgroundColor: "#001C3E", color: "WHITE", float: 'right', marginRight: "1200px" }}>SAVE</Button></div>
          </form>

          <Paper className={classes.paper}><HorizontalBar
